import React from 'react'
import { response } from 'express'


const lakes = async() => {
    await fetch('/lakes')
    .then(response => response.json())
    .then(rsp => console.log(rsp))
}

const Home = () =>{
    return <div>
        <h1>THIS IS HOME</h1>
        {lakes()}
    </div>
}
export default Home
